vs/workbench/contrib/terminal/common/ter.terminal.integrated.commandsToSkipShell:
Sada ID příkazů, jejichž klávesové zkratky nebudou odeslány do prostředí, ale místo toho je bude vždy zpracovávat VS Code. To umožňuje používat klávesové zkratky, které by normálně byly zachyceny prostředím, jako kdyby terminál neměl fokus, například Ctrl+P pro spuštění rychlého otevření.

&nbsp;

Ve výchozím nastavení je mnoho příkazů přeskakováno. Pokud chcete výchozí nastavení přepsat a místo toho předat prostředí klávesovou zkratku daného příkazu, přidejte příkaz s předponou „-“. Například přidáním příkazu -workbench.action.quickOpen umožníte předání klávesové zkratky Ctrl+P do prostředí.

&nbsp;

