vs/workbench/contrib/welcomeGettingStart.gettingStarted.accessibilityHelp.descrip:
Dialogové okno nápovědy k funkcím přístupnosti poskytuje informace o tom, co lze od dané funkce očekávat, a o příkazech / klávesových zkratkách pro její ovládání.
 Když je fokus v editoru, terminálu, poznámkovém bloku, odpovědi chatu, komentáři nebo ladicí konzole, lze otevřít příslušné dialogové okno příkazem Otevřít nápovědu k přístupnosti.
