vs/workbench/contrib/welcomeGettingStart.gettingStarted.verbositySettings.descrip:
Pro funkce na pracovní ploše jsou k dispozici nastavení podrobností pro čtečku obrazovky zobrazované nápovědy. Jakmile se uživatel s danou funkcí seznámí, může nastavit, aby se nezobrazovala nápověda, jak ji používat. Například u funkcí, pro které existuje dialogové okno nápovědy k přístupnosti, bude uvedeno, jak toto dialogové okno otevřít, dokud nebude pro danou funkci nastavení podrobností zakázáno.
 Tato a další nastavení přístupnosti lze nakonfigurovat spuštěním příkazu Otevřít nastavení přístupnosti.
